    - type: Paper
      content: >-
        Weymart shut down without notice.


        No announcement, no evacuation tape. One day the doors were locked, the next the street filled with webs and nobody asked why. Station records say structural risk. They say that about a lot of places that wont stay quiet.


        At night, the building makes sounds it shouldnt. Soft taps. Long dragging noises. Sometimes the chime tries to play and stops halfway through, like something interrupts it.


        Security sealed the entrances and painted warning marks on the walls. They didnt clear it out. They just stopped going near it.


        If you need supplies, go somewhere else.

        If you hear movement inside, dont listen too long.

        And if the doors are open, they didnt open for you.
