    - type: Paper
      content: >-
        Internal Memo  Copy #3


        Reminder to all staff:


         Do not relocate shared equipment without filing a movement form (WM-12). This includes, but is not limited to: chairs, tablets, portable scanners, and temporarily borrowed desk fans.


         Breakroom power cycling is scheduled for 14:0014:15. Any appliances left plugged in during this window may be permanently disabled. This has already happened twice.


         Please stop submitting maintenance tickets for issues described as weird, wrong, or probably nothing. If something is not broken, jammed, leaking, or on fire, it does not require escalation.


         Lost-and-found is not a storage solution. Items left longer than seven days will be disposed of, regardless of perceived usefulness.


        Failure to follow standard procedure will result in retraining.


         Facilities Coordination

        Weymart Station Annex
